import React from 'react';
import ReactDOM from 'react-dom';
import Image from 'react-bootstrap/Image';
import GreenCityBackground from './img/green_city.jpg';
import './App.css';
import TreeImage from '../img/illustrations/undraw_Tree_swing_646s.svg';
import CollabImage from '../img/illustrations/undraw_shared_workspace_hwky.svg';



function IntroSlide() {
  return (
  	<div id="introSlide">
		  <div class="col">
			  <img
				  class="img-fluid"
				  src={TreeImage}
				  alt="For Companies"
			  />

		  </div>
		  <div class="col">
			  <h1 className="text-dark"><br /> Do Better In Tech</h1>
			  <br></br>
			  <h2 className="text-dark">Welcome to Impactful.</h2> 
		  </div>		  

		  <div class="col">
			  <img
				  class="img-fluid"
				  src={CollabImage}
				  alt="For Companies"
			  />

		  </div>
	  {/* <div className="container bg-no-overlay text-center"  fluid>

	  </div> */}
  	</div>
  )
}

export default IntroSlide;
